import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';


function App() {
    return (
      <div className="App">
      <BrowserRouter>
            <Routes>
                <Route></Route>
                <Route exact path="/create" element={<Create/>} />
                <Route exact path="/read" element={<Read/>} />
                <Route exact path="/update" element={<Update/>} />
            </Routes>
      </BrowserRouter>
      </div>
    );
  }

  export default App;
